import React from "react";
import "./App.css";
import logo from "./final-inkling-logo.png";
// import { Menu, MenuItem, MenuHeader } from "semantic-ui-react";
import About from "./About";
import Code from "./Code";
// import MenuExampleMenus from "./NavBar";
import Navbar from "react-bootstrap/Navbar";

function App() {
  return (
    <div className="App">
      {/* <h1>Inkling</h1> */}
      {/* <Menu compact fixed>
        <MenuItem>Inkling</MenuItem>
        <MenuItem>About</MenuItem>
        <MenuItem>Code Examples</MenuItem>
        <MenuItem>Learn More</MenuItem>
      </Menu> */}
      {/* <MenuExampleMenus></MenuExampleMenus> */}
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
            <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Nav>
            <Nav.Link href="#deets">More deets</Nav.Link>
            <Nav.Link eventKey={2} href="#memes">
              Dank memes
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      <img className="logo" src={logo}></img>
      <About></About>
      <Code></Code>
    </div>
  );
}

export default App;
